import Navbar from "./navbar";

const styles = {
  container: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    height: "100vh", // Adjust as needed
  },
  content: {
    flex: 1,
    padding: "20px",
  },
  imageContainer: {
    flex: 0,
    display: "flex",
    justifyContent: "flex-end",
    alignItems: "center",
  },
};

export default function StudentPage() {
  return (
    <>
      <Navbar />
      <Instudentpage />
    </>
  );
}

function Instudentpage() {
  return (
    <div className="main">
      <div style={styles.imageContainer}></div>
    </div>
  );
}
